import { Component, Inject } from '@angular/core';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})

class RegisterData {
  username: string;
  password: string;
  email: string;
  role: string;
  tmbd_key: string;

  constructor(@Inject(String) username: string, @Inject(String) password: string, @Inject(String) email: string, @Inject(String) role: string, @Inject(String) tmbd_key: string) {
    this.username = username;
    this.password = password;
    this.email = email;
    this.role = role;
    this.tmbd_key = tmbd_key;
  }
}

export class RegisterComponent {
    username: string = "";
    password: string = "";
    email: string = "";
    role: string = "";
    tmbd_key: string = "";
    screen: number = 1;

    next_screen() {
      if (this.screen < 3) {
        this.screen += 1;
    }
  }

    prev_screen() {
      if (this.screen > 1) {
        this.screen -= 1;
      }
    }

    submit_form() {
      let data = new RegisterData(this.username, this.password, this.email, this.role, this.tmbd_key);
      console.log(data);
    }

}
